import React from 'react';
import { Link } from 'react-router-dom';
import './NavBar.css';
import logo from '../../img/logo.png';


export function NavBar() {
    return (
        <nav >
        <img src={logo} alt='...' />
        <ul>
        <Link to='/'> <li>iWorld! </li> </Link>
        <Link to='/home'> <li className='dropbtn'>Home</li> </Link>
          <li className="dropdown"> <p href='/addactivity' className='dropbtn'>Actividades </p>
           <div className="dropdown-content">
             <Link to='/addactivity'><li> Agregar Actividades </li></Link>
             <Link to='/listactivity'><a href='/listactivity'> Ver Actividades por Pais </a></Link>
           </div>
          </li>
        <Link to='/about'> <li><a href='/listactivity' className='dropbtn'> Sobre el Proyecto </a> </li> </Link>
        </ul>
    </nav>
    )
};

export default NavBar;
